import React from "react";
import "./Main.css";

const Main = () => {
  return (
      <div className="main">
        <div className="container">
          <nav className="header">
            <div className="logoBox"></div>
            <div className="searchForm"></div>
            <div className="userMenu"></div>
          </nav>
        </div>
      </div>
  );
};

export default Main;
